            }else if (g5.dataset2.getData(x,y) == 3){
                d += "<td>已打印</td>";
            }else if (g5.dataset2.getData(x,y) == 4){
                d += "<td>已退款</td>";
            }else if (g5.dataset2.getData(x,y) == 5){
                d += "<td>已关闭</td>";
            }else {
                d += "<td>异常</td>";
            }
        }else {
            d += "<td>" + g5.dataset2.getData(x,y) + "</td>";       
        }
    }
    d += "</tr>";
}
d += "<tr><td></td><td></td><td></td><td></td><td>退款金额</td><td></td><td>"+ bmax +"</td><td></td><td>"+bmax+"</td><tr>";
d += "<tr><td></td><td></td><td></td><td></td><td>科二模拟超时现金收入</td><td></td><td></td><td>"+ cmax +"</td><td>"+cmax+"</td><tr>";
