d += "<tr><td></td><td></td><td></td><td></td><td>最终营业</td><td></td><td></td><td></td><td>"+summax+"</td><tr>";
d = "<table>" + d + "</table>";

tableToExcel(d, "华茂基地网络售票统计系统");

